import React, { Component } from "react";
import { BootstrapTable, TableHeaderColumn } from "react-bootstrap-table";
//import "../css/Table.css";
import "../../node_modules/react-bootstrap-table/css/react-bootstrap-table.css";

function buttonFormatter(cell, row) {
  return '<BootstrapButton type="submit"></BootstrapButton>';
}

class Table1 extends Component {
  render() {
    return (
      <div>
        <BootstrapTable data={this.props.data}>
          <TableHeaderColumn isKey dataField="_id" hidden>
            ID
          </TableHeaderColumn>
          <TableHeaderColumn dataField="title">Title</TableHeaderColumn>

          <TableHeaderColumn dataField="numberInStock">Stock</TableHeaderColumn>
          <TableHeaderColumn dataField="dailyRentalRate">
            Rate
          </TableHeaderColumn>
          <TableHeaderColumn dataField="button" dataFormat={buttonFormatter}>
            Buttons
          </TableHeaderColumn>
        </BootstrapTable>
      </div>
    );
  }
}

export default Table1;
